import React from 'react';

export default ({id, text, done, deletefunction, donefunction}) => {
    return (
        <>
            <input type="checkbox" defaultChecked={done ? 'checked': ''} onClick={() => donefunction(id)} className={done ? 'checked': ''}/>
            <p>{text}</p>
            <button onClick={() => deletefunction(id)}>REMOVE</button>
        </>
    );
}
